import React, { Component } from 'react';
import { Pane, Heading, Button, Text } from 'evergreen-ui'
import '../styles/styles.scss'

class Index extends Component {

  render() {
    return (
      <div id="App">
      <Pane display="flex" height={150} alignItems="center" justifyContent="center">
        <Heading size={700}>COVID-19 "How To" Tracker</Heading>
      </Pane>
      <Pane display="flex" height={100} alignItems="center" justifyContent="center">
        <Heading size={500}>Trending Narratives</Heading>
      </Pane>
      <Pane display="flex" padding={16} background="tint2" borderRadius={3}>
      </Pane>
      </div>
    );
  }

}

export default Index;
